import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import {
  Link, Outlet
} from "react-router-dom";
// import Mobiles from './Mobiles';
import React  from 'react';

function Products() {
  return (
    <>

      <div className='product_background'>
        <Card style={{ width: '75rem', height: '25rem' }} className='product_margin'>
          <Card.Body>
            <div class="Product">


              <div className="product1">
                <h4 ><b class='category'>Category</b></h4>

                <Button variant="light" className='product_button' >Head Phones</Button><br></br>
                <Link to='/Product/Mobiles'> <Button variant="light" className='product_button'>Mobiles</Button></Link><br></br>
                <Button variant="light" className='product_button'>Glosary</Button><br></br>
                <Button variant="light" className='product_button'>Wathches</Button><br></br>
                <Button variant="light" className='product_button'>TV</Button><br></br>
                <Button variant="light" className='product_button'>Fans</Button><br></br>
                <Button variant="light" className='product_button'>Laptop</Button><br></br>




              </div>

              <div className="description product2">

                <Outlet />

                {/* <Outlet /> */}

              </div>


            </div>
          </Card.Body>
        </Card>
      </div>

    </>
  );
}
export default Products;
